    static ArrayList<String> getTextFromFile(String fileName) throws IOException {
        ArrayList<String> output = new ArrayList<>();
        String n;
        BufferedReader reader = new BufferedReader(new FileReader(fileName));
        while ((n = reader.readLine()) != null) {
            output.add(n);
        }
        reader.close();
        return output;
    }

    public String getLineFromFile(String fileName, int line) throws IOException {
        String output = "";
        String n;
        int currentLine = 0;
        BufferedReader reader = new BufferedReader(new FileReader(fileName));
        while ((n = reader.readLine()) != null) {
            output = currentLine == line ? n : "";
            if (!output.equals("")) break;
            currentLine++;
        }
        reader.close();
        return output;
    }

    static boolean verifyTypes() throws IOException {
        ArrayList<String> typesList = getTextFromFile("types.txt");
        String[] currentTypes;
        for (String s : typesList) {
            currentTypes = s.split(" ");
            for (String sTwo : currentTypes) {
                assert PokemonType.contains(sTwo) : "rip :( " + sTwo + " isn't a valid type bro";
            }
        }
        return true;
    }
